import logo from './logo.svg';
import './App.css';
import Button from './components/Button/Button';

function App() {
  return (
    <div className="App">
      <Button type={"confirm"} width={70} height={25} text={"Create"}/>
      <Button type={"cancel"} width={70} height={25} text={"Cancel"} fontSize={"20px"}/>
    </div>
  );
}

export default App;
